    number: number;
}
function Serre(props: SerreProps) {
    const classes = useStyles();
    const { number } = props;
    return (
        <div>
            <Typography variant="h6" className={classes.serre}>
                Serre {number}
            </Typography>
            <Grid container spacing={3}>
                <Grid item xs={6}>
                    <CardTH typeData="Temperature"/>
                </Grid>
                <Grid item xs={6}>
                    <CardTH typeData="Humidite"/>
                </Grid>
            </Grid>
        </div>
    );
}

export default Serre;
